import './home.css';
import Img from './Notes.gif';

const Home = ({value})=>{
    console.log(value);
    return(
        <div className="home container-fluid p-5 row m-0">
            <h2 className="col p-5 mx-5 fw-bold fs-2">
                Your personal notes storage app !!
            </h2>
            <div className="img col text-center">
                <img src={Img} alt="" />
            </div>
        </div>
    );
}

export default Home;
